import React, { useState } from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Grid, 
  Card, 
  CardContent, 
  CardMedia,
  Button,
  Stack,
  Chip,
  CardActionArea
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import VerifiedIcon from '@mui/icons-material/Verified';

// Mock data for latest drops
const latestDrops = [
  {
    id: 1,
    title: 'Abstract Thought of Art',
    creator: 'ZafGod.eth',
    price: '0.00069 ETH',
    image: 'https://via.placeholder.com/400x400/1a237e/ffffff',
    status: 'Now',
    isVerified: true
  },
  {
    id: 2,
    title: 'Harvested Opulence',
    creator: 'Fame Identity',
    price: '0.005 ETH',
    image: 'https://via.placeholder.com/400x400/4a148c/ffffff',
    status: '23 hours',
    isVerified: true
  },
  {
    id: 3,
    title: 'RELAX',
    creator: 'brain pasta',
    price: '0.0038 ETH',
    image: 'https://via.placeholder.com/400x400/311b92/ffffff',
    status: 'Now',
    isVerified: true
  },
  {
    id: 4,
    title: 'Spring will come',
    creator: 'Reza Milani',
    price: '0.0004 ETH',
    image: 'https://via.placeholder.com/400x400/6a1b9a/ffffff',
    status: 'Now',
    isVerified: true
  }
];

const Home = () => {
  const navigate = useNavigate();
  const [hoveredId, setHoveredId] = useState<number | null>(null);

  return (
    <Container maxWidth="xl" sx={{ mt: 4, pb: 8 }}>
      {/* Header Section */}
      <Box sx={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center',
        mb: 4
      }}>
        <Typography variant="h5" component="h1" sx={{ fontWeight: 'bold' }}>
          Latest drops
        </Typography>
      </Box>

      {/* NFT Grid */}
      <Grid container spacing={2}>
        {latestDrops.map((nft) => (
          <Grid item key={nft.id} xs={12} sm={6} md={3} lg={3}>
            <Card 
              sx={{ 
                bgcolor: 'rgba(22, 28, 36, 0.95)',
                borderRadius: 2,
                position: 'relative',
                aspectRatio: '1/1',
                cursor: 'pointer'
              }}
              onMouseEnter={() => setHoveredId(nft.id)}
              onMouseLeave={() => setHoveredId(null)}
            >
              <CardActionArea>
                <CardMedia
                  component="img"
                  image={nft.image}
                  alt={nft.title}
                  sx={{ 
                    height: '100%',
                    width: '100%',
                    aspectRatio: '1/1'
                  }}
                />
                {hoveredId === nft.id && (
                  <Box
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      right: 0,
                      bottom: 0,
                      bgcolor: 'rgba(0, 0, 0, 0.5)',
                      display: 'flex',
                      justifyContent: 'center',
                      alignItems: 'center',
                      transition: 'all 0.3s ease-in-out'
                    }}
                  >
                    <Button
                      variant="contained"
                      sx={{
                        bgcolor: 'white',
                        color: 'black',
                        '&:hover': {
                          bgcolor: 'white',
                        },
                        borderRadius: '20px',
                        px: 3
                      }}
                    >
                      Mint Now
                    </Button>
                  </Box>
                )}
              </CardActionArea>
              <Box sx={{ 
                position: 'absolute', 
                bottom: 0, 
                left: 0, 
                right: 0,
                p: 2,
                background: 'linear-gradient(to top, rgba(0,0,0,0.8) 0%, rgba(0,0,0,0) 100%)'
              }}>
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Typography variant="subtitle2" sx={{ color: 'grey.400' }}>
                    {nft.creator}
                  </Typography>
                  {nft.isVerified && (
                    <VerifiedIcon sx={{ fontSize: 16, color: '#2196f3' }} />
                  )}
                </Box>
                <Typography variant="subtitle1" sx={{ color: 'white', fontWeight: 'bold' }}>
                  {nft.title}
                </Typography>
                <Box sx={{ 
                  display: 'flex', 
                  justifyContent: 'space-between',
                  alignItems: 'center',
                  mt: 1 
                }}>
                  <Box>
                    <Typography variant="caption" sx={{ color: 'grey.400' }}>
                      Minting
                    </Typography>
                    <Typography variant="body2" sx={{ color: 'white', fontWeight: 'bold' }}>
                      {nft.price}
                    </Typography>
                  </Box>
                  <Typography 
                    variant="caption" 
                    sx={{ 
                      color: nft.status === 'Now' ? '#4caf50' : 'white',
                      fontWeight: 'bold'
                    }}
                  >
                    • {nft.status}
                  </Typography>
                </Box>
              </Box>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Home;
